    super(props);
    this.state = {
      about: [],
    };
  }

  render() {
    const about = this.state.about.map((about, i) => {
      return (
        <>
          <style jsx>{`
            p,
            h3 {
              color: white;
              font-family: Oswald;
              font-size: 20px;
            }

            p {
              width: 80%;
              margin: 3% auto;
            }

            h3 {
              width: 80%;
              margin: 0 auto;
              text-align: center;
            }
            img {
